import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

// Componentes que você precisa criar
import Login from "./Auth/App.jspages/Login";
import Register from "./Auth/App.js/pages/Register";

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Get A Pet</h1>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
